import React from 'react'
import {AppBar,Toolbar,Typography,makeStyles} from '@mui/material'

const Navbar = () => {
    return (
        <AppBar className={classes.header} position="static">
            <Toolbar>
            <Typography component="h2">Utilize</Typography>
            </Toolbar>
        </AppBar>
    )
}

export default Navbar
